import React from 'react';
import '../style/style.css'; // Import your custom CSS

const TopHeader = () => {
  return (
    <div className="top_header">
      <div className="marquee-container">
        <div className="marquee">
          <span>Shop for Rs 2499/- & get 10% OFF | Use Code: SHOP10 </span>
          <span>Shop for Rs 3999/- & Get FLAT 15% OFF | Use Code: SHOP15 </span>
          <span>Flat 25% off | USE CODE: FINALCALL | <a href="#">CLICK HERE</a></span>
        </div>
      </div>
    </div>
  );
}

export default TopHeader;
